import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import SearchComponent from "../components/SearchComponent";

const Home = () => {
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState(""); // Add state variable for search term

  const handleSearch = () => {
    navigate(`/gameindex?search=${encodeURIComponent(searchTerm)}`);
  };

  return (
    <>
      {/* ... */}
      <SearchComponent
        handleSearch={handleSearch}
        setSearchTerm={setSearchTerm} // Pass setSearchTerm to update the search term state
      />
    </>
  );
};
